$("#eventsCarousel").on("slide.bs.carousel",(function(e){var o=$(e.relatedTarget).index(),r=$(".carousel-item").length;if(o>=r-3)for(var a=4-(r-o),n=0;n<a;n++)"left"==e.direction?$(".carousel-item").eq(n).appendTo(".carousel-inner"):$(".carousel-item").eq(0).appendTo(".carousel-inner")})),$(".carousel").on("touchstart",(function(e){var o=e.originalEvent.touches[0].pageX;$(this).one("touchmove",(function(e){var r=e.originalEvent.touches[0].pageX;Math.floor(o-r)>5?$(".carousel").carousel("next"):Math.floor(o-r)<-5&&$(".carousel").carousel("prev")})),$(".carousel").on("touchend",(function(){$(this).off("touchmove")}))}));